import React from "react";
import Card from "./Card";
import Button from "./Button";

function ErrorModal(props) {
  return (
    <Card>
      <header>
        <h1>{props.title}</h1>
      </header>
      <div>
        <p>props.message</p>
      </div>
      <footer>
        <Button>Okay</Button>
      </footer>
    </Card>
  );
}

export default ErrorModal;
